import React from "react";
import Hero from "./Hero";
import About from "./About";
import CardGallery from "./CardGallery";
import Testimonial from "./Testimonial";
import Faq from "./Faq";

function Home() {
  return (
    <>
      <Hero />
      <About />
      <CardGallery />
      <Testimonial />
      <Faq />
    </>
  );
}

export default Home;
